import React, { Component } from 'react';
import 'assets/css/estilos.css';

import MainStore from 'app/stores/MainStore';
import { cadastrarUsuario } from 'app/actions/CadastroActions';

export class CadastroView extends Component {
    constructor(props){
        super(props);
        this.state = {
            nome: '',
            sobrenome: '',
            telefone: '',
            email: ''
        };

        this.cadastrar = this.cadastrar.bind(this.state)
    }

    cadastrar = usuario => MainStore.dispatch(cadastrarUsuario(usuario));

    render() {
        return (
            <div>
                <header>
                    <p>Teste</p>
                    <label for="nome">Nome: </label>
                    <input id="nome" type="text" value={this.state.nome} onChange={(e) => this.setState({ nome: e.target.value })} /><br />
                    <label for="sobrenome">Sobrenome: </label>
                    <input id="sobrenome" type="text" value={this.state.sobrenome} onChange={(e) => this.setState({ sobrenome: e.target.value })} /><br />
                    <label for="telefone">Telefone: </label>
                    <input id="telefone" type="text" value={this.state.telefone} onChange={(e) => this.setState({ telefone: e.target.value })} /><br />
                    <label for="email">E-Mail: </label>
                    <input id="email" type="email" value={this.state.email} /><br />
                    <input type="submit" name="Enviar" onClick={() => this.cadastrar} onChange={(e) => this.setState({ email: e.target.value })} />
                </header>
            </div>
        );
    }
}
